import logo from '../../images/logo01.svg';
import './style.css';
import styled from 'styled-components';

const LogoStyleImg = styled.img`
    margin-right: 10px;
    margin-left: 35px;
    height: 96px;
    width: 96px;
`;

const AppLogo = styled.div`
    display: flex;
    align-items: center;
    font-size: 50px;
`;

function Logo() {
    return (
        <div className='App-logo'>
            <LogoStyleImg src={logo} alt="Logo" />
            <p className='just-me-again-down-here-regular'><strong>MoveX</strong></p>
        </div>
    );
}

export default Logo;
